description:
Người đ&agrave;n &ocirc;ng b&iacute; ẩn ra ngục kh&ocirc;ng l&acirc;u lu&ocirc;n lang thang trong c&aacute;i th&agrave;nh phố ấm &aacute;p ba năm trước nay chỉ c&ograve;n lại nỗi hận n&agrave;y. Anh ta c&oacute; hai nguyện vọng, một l&agrave; ch&ocirc;n cất con g&aacute;i m&igrave;nh về ph&iacute;a Nam, sau đ&oacute; giết chết kẻ đ&atilde; hủy hoại cuộc đời của m&igrave;nh. Hai người c&oacute; cuộc đời kh&aacute;c nhau b&aacute;c sĩ huyết dịch L&acirc;m Ti&ecirc;u Phong v&agrave; nh&acirc;n vi&ecirc;n bảo hiểm Kỷ Ph&agrave;m, nữ cường nh&acirc;n giới thương trường L&yacute; Nhược Nam, nữ vương phản nghịch Diệc H&agrave;m, Lục ca tự xưng l&agrave; tinh anh của Kim Dung... Tất cả bọn họ đều c&oacute; cuộc sống ri&ecirc;ng của m&igrave;nh nhưng v&igrave; một vụ &aacute;n bắt c&oacute;c m&agrave; d&acirc;y dưa v&agrave;o nhau...
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;

Vanessa Helsing, người họ h&agrave;ng xa của thợ săn ma c&agrave; rồng nổi tiếng Abraham Van Helsing, được hồi sinh chỉ để chứng kiến ma c&agrave; rồng chiếm lĩnh thế giới, C&ocirc; l&agrave; niềm hy vọng cuối c&ugrave;ng của nh&acirc;n loại dẫn dắt cuộc chiến gi&agrave;nh lại những g&igrave; đ&atilde; mất.
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;

Chuyến bay số hiệu 828 đ&atilde; hạ c&aacute;nh an to&agrave;n sau một chặng bay kh&ocirc;ng mấy &ecirc;m ả, phi h&agrave;nh đo&agrave;n v&agrave; tất cả h&agrave;nh kh&aacute;ch đều thở ph&agrave;o nhẹ nh&otilde;m. Tuy nhi&ecirc;n, họ được cho biết rằng thế giới đ&atilde; trải qua 5 năm rưỡi kể từ l&uacute;c họ bước l&ecirc;n chuyến bay đ&oacute;. Gia đ&igrave;nh, bạn b&egrave; v&agrave; đồng nghiệp của họ đ&atilde; từ bỏ mọi nỗ lực t&igrave;m kiếm sau ngần ấy năm, v&agrave; chấp nhận sự thật họ đ&atilde; chết th&igrave; đột nhi&ecirc;n họ lại trở về. 
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Đối mặt với điều tưởng chừng như kh&ocirc;ng thể n&agrave;y, tất cả đều kh&ocirc;ng thể giải th&iacute;ch được, chuyện g&igrave; đ&atilde; xảy ra với họ?&lt;/div&gt;

Phim Siren - Nh&acirc;n Ngư xoay quanh Bristol Cove - một thị trấn ven biển y&ecirc;n b&igrave;nh v&agrave; tươi đẹp. Huyền thoại kể rằng nơi đ&acirc;y từng l&agrave; nh&agrave; của Ti&ecirc;n C&aacute;. Khi một c&ocirc; g&aacute;i b&iacute; ẩn đột ngột xuất hiện v&agrave; k&eacute;o theo sau đ&oacute; h&agrave;ng loạt c&aacute;i chết t&agrave;n nhẫn th&igrave; mọi người bắt đầu tin v&agrave;o huyển thoại ng&agrave;y xưa truyền lại. Kh&ocirc;ng như những N&agrave;ng Ti&ecirc;n C&aacute; hiền l&agrave;nh trong c&acirc;u chuyện cổ t&iacute;ch, giống lo&agrave;i Nh&acirc;n Ngư rất lạnh l&ugrave;ng v&agrave; t&agrave;n bạo. 
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Cuộc chiến giữa con người v&agrave; đại dương ch&iacute;nh thức bắt đầu khi c&aacute;c Nh&acirc;n Ngư trở lại để gi&agrave;nh lấy v&ugrave;ng biển vốn thuộc về m&igrave;nh...&lt;/div&gt;

Season 2 tiếp tục xoay quanh Bristol Cove - một thị trấn biển y&ecirc;n b&igrave;nh v&agrave; tươi đẹp. Huyền thoại kể rằng nơi đ&acirc;y từng l&agrave; nh&agrave; của Ti&ecirc;n C&aacute;. Khi một c&ocirc; g&aacute;i b&iacute; ẩn đột ngột xuất hiện v&agrave; k&eacute;o theo sau đ&oacute; h&agrave;ng loạt c&aacute;i chết t&agrave;n nhẫn th&igrave; mọi người bắt đầu tin v&agrave;o huyển thoại ng&agrave;y xưa truyền lại. Kh&ocirc;ng như những N&agrave;ng Ti&ecirc;n C&aacute; hiền l&agrave;nh trong c&acirc;u chuyện cổ t&iacute;ch, giống lo&agrave;i Nh&acirc;n Ngư rất lạnh l&ugrave;ng v&agrave; t&agrave;n bạo. Cuộc chiến giữa con người v&agrave; đại dương ch&iacute;nh thức bắt đầu khi c&aacute;c Nh&acirc;n Ngư trở lại để gi&agrave;nh lấy v&ugrave;ng biển vốn thuộc về m&igrave;nh...
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;

How to Get Away with Murder phần 5 tiếp tục kể về một nh&oacute;m sinh vi&ecirc;n luật đầy tham vọng v&agrave; vị gi&aacute;o sư b&agrave;o chữa h&igrave;nh sự tuyệt vời của họ c&ugrave;ng tham gia v&agrave;o một &acirc;m mưu giết người hứa hẹn sẽ thay đổi ho&agrave;n to&agrave;n cuộc sống của mỗi người...
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Giảng vi&ecirc;n nhọ nhất Annalise c&ugrave;ng đ&aacute;m l&acirc;u la đ&atilde; quay trở lại. Liệu m&ugrave;a n&agrave;y Anna c&oacute; phải thu dọn t&agrave;n cuộc từ đ&aacute;m đệ tử? Liệu c&oacute; c&ograve;n c&aacute;c c&uacute; twist khiến kh&aacute;n giả n&iacute;n thở, b&agrave;ng ho&agrave;ng thậm ch&iacute; chửi thề? Bao nhi&ecirc;u người sẽ chết tiếp theo?&lt;/div&gt;

Nội dung c&acirc;u chuyện xoay quanh một nh&oacute;m gồm 3 g&atilde; yakuza bặm trợn đ&atilde; thất bại nhiệm vụ được giao. Thế l&agrave; &ocirc;ng boss đ&atilde; cho 3 g&atilde; ấy 2 sự lựa chọn: 1 l&agrave; mổ bụng tự s&aacute;t, 2 l&agrave; đi sang Th&aacute;i Lan phẫu thuật chuyển giới th&agrave;nh 3 c&ocirc; g&aacute;i v&agrave; th&agrave;nh lập một nh&oacute;m nhạc idol. Sau một năm trải qua nhiều đợt phẫu thuật, trị liệu v&agrave; luyện tập, cả 3 đ&atilde; c&oacute; thể xuất hiện trước c&ocirc;ng ch&uacute;ng lần đầu ti&ecirc;n. Ngờ đ&acirc;u họ lại qu&aacute; nổi tiếng bởi vẻ ngo&agrave;i cực đ&aacute;ng y&ecirc;u của m&igrave;nh, mọi rắc rối bắt đầu từ đ&oacute;.
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Back Street Girls thuộc thể loại &quot;chuyển giới&quot; thường thấy, nhưng điều đặc biệt ở đ&acirc;y ch&iacute;nh l&agrave; t&iacute;nh c&aacute;ch yakuza th&ocirc; lỗ, cục cằn giờ đ&acirc;y đ&atilde; được nh&eacute;t trong th&acirc;n h&igrave;nh c&aacute;c c&ocirc; g&aacute;i đ&aacute;ng y&ecirc;u. C&oacute; vẻ l&agrave; một bộ live-action th&uacute; vị đấy c&aacute;c bạn!&lt;/div&gt;

C&acirc;u chuyện lấy bối cảnh v&agrave;o giữa thời đại Muromachi, v&agrave;o khoảng thập ni&ecirc;n 70 của thế kỉ 15, sau trận chiến của Onin v&agrave; Bunmei. C&acirc;u chuyện kể về Hyakkimaru - một ch&agrave;ng trai trẻ khi mới sinh ra l&agrave; đ&atilde; bị mất 48 bộ phận tr&ecirc;n cơ thể. Điều bi thảm m&agrave; anh phải g&aacute;nh chịu n&agrave;y l&agrave; do cha của anh - Kagemitsu Daigo - đ&atilde; lập một lời hứa với bọn quỷ dữ, v&igrave; &ocirc;ng muốn thống trị đất nước n&agrave;y. C&aacute;i gi&aacute; cho lời hứa đ&oacute; ch&iacute;nh l&agrave; 48 bộ ph&acirc;n tr&ecirc;n cơ thể của Hyakkimaru. V&igrave; thế, vừa mới sinh ra, Hyakkimaru đ&atilde; bị khuyết tật đầy m&igrave;nh v&agrave; bị gia đ&igrave;nh ruồng bỏ, thả anh tr&ocirc;i s&ocirc;ng. 
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Hyakkimaru giờ đ&atilde; trưởng th&agrave;nh v&agrave; anh lắp tr&ecirc;n người m&igrave;nh những phần cơ thể giả để c&oacute; thể ti&ecirc;u diệt 48 con quỷ, nhằm lấy lại những phần cơ thể của m&igrave;nh. Tr&ecirc;n cuộc h&agrave;nh tr&igrave;nh ấy, anh đ&atilde; gặp gỡ cậu nh&oacute;c Dororo v&agrave; hai người trở th&agrave;nh bạn.&lt;/div&gt;

Phim Đồi Thỏ dựa tr&ecirc;n tiểu thuyết c&ugrave;ng t&ecirc;n của nh&agrave; văn Richard Adams kể về cuộc phi&ecirc;u lưu của những ch&uacute; thỏ từ bỏ qu&ecirc; hương của m&igrave;nh để t&igrave;m đến một v&ugrave;ng đất mới theo những lời ti&ecirc;n tri của một ch&uacute; thỏ c&oacute; t&ecirc;n l&agrave; Thứ Năm, qu&ecirc; hương của ch&uacute;ng gặp nguy hiểm bởi con người đ&atilde; x&acirc;y dựng một trung t&acirc;m giải tr&iacute; v&agrave; giết hết thỏ tr&ecirc;n c&aacute;nh đồng. Ch&uacute;ng đ&atilde; trải qua rất nhiều thử th&aacute;ch v&agrave; nguy hiểm, v&agrave; cuối c&ugrave;ng đ&atilde; đến được đồi Watership để x&acirc;y dựng một Đồi Thỏ mới rộng lớn.
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;

D&ograve;ng đời x&ocirc; đẩy, thiếu nữ xinh đẹp Nhan Như Ngọc nối nghiệp cha l&agrave;m b&agrave; mai, từ đ&oacute; biết bao chuyện dở kh&oacute;c dở cười xoay quanh việc se duy&ecirc;n cho b&agrave;n d&acirc;n thi&ecirc;n hạ.
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;

Thời kỳ d&acirc;n quốc, hiệu trưởng trường đại học Th&aacute;nh Th&agrave;nh chết một c&aacute;ch b&iacute; ẩn, tổ trinh th&aacute;m nhỏ bao gồm c&ocirc; g&aacute;i bạo lực Trần Hi (Diệp Thanh), c&ocirc;ng tử l&ecirc;u lổng nhưng rất c&oacute; năng lực suy luận B&ugrave;i Nham (Nhiễm H&uacute;c), Anh Tuấn con trai thị trưởng (Di&ecirc;u Nhất Kỳ) c&ugrave;ng với b&aacute;t qu&aacute;i cung gia truyền, Cung Tử (H&igrave;nh &Acirc;n) được th&agrave;nh lập để phối hợp điều tra &aacute;n mạng. 
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Đi s&acirc;u v&agrave;o điều tra, tổ chức thần b&iacute; Hoa Mai Q dần dần lộ ra, c&ograve;n cả những kẻ địch kh&ocirc;ng nh&igrave;n thấy. Một d&ograve;ng nước ngầm vốn nằm s&acirc;u trong nước ở Th&aacute;nh Th&agrave;nh v&ocirc; t&igrave;nh tr&agrave;n l&ecirc;n, c&acirc;u chuyện tưởng chừng c&agrave;ng ng&agrave;y c&agrave;ng vượt qua sự hiểu biết của họ. Họ đối mặt với mu&ocirc;n v&agrave;n nghi vấn, đồng t&acirc;m hiệp lực, nguyện tra ra sự thật tới c&ugrave;ng.&nbsp;&lt;/div&gt;

Phim bắt đầu từ c&aacute;i chết của Kathearina (hay c&ograve;n gọi l&agrave; K), một c&ocirc; ca sĩ quyến rũ t&oacute;c đỏ. L&ocirc;ng, t&oacute;c v&agrave; c&aacute;c bộ phận đc cho l&agrave; &ldquo;đậm m&ugrave;i&rdquo; của thi thể bị lấy đi. Cuộc điều tra dẫn thanh tra đến với những người bạn thuở ni&ecirc;n thiếu của K &ndash; một hội fan h&acirc;m mộ tiểu thuyết Perfume (M&ugrave;i hương) của nh&agrave; văn Patrick S&uuml;skind. Cảnh s&aacute;t cũng điều tra ra được l&agrave; đ&atilde; từng c&oacute; 2 vụ mất t&iacute;ch ở ng&ocirc;i trường đ&aacute;m bạn n&agrave;y theo học. Phim xoay quanh mối quan hệ của đ&aacute;m bạn l&uacute;c ni&ecirc;n thiếu v&agrave; hiện tại v&agrave; cả mối quan hệ c&aacute; nh&acirc;n phức tạp của nữ thanh tra phụ tr&aacute;ch vụ &aacute;n.
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;

Kageyama Shigeo (c&ograve;n hay được gọi l&agrave; Mob) l&agrave; một cậu học sinh lớp 8 &quot;b&igrave;nh thường&quot;, sở hữu năng lực si&ecirc;u nhi&ecirc;n. Từ khi c&ograve;n nhỏ, bằng linh lực của m&igrave;nh, cậu c&oacute; thể bẻ cong muỗng, v&agrave; n&acirc;ng đồ vật, nhưng dần dần Mob bắt đầu kiềm n&eacute;n sức mạnh của m&igrave;nh v&igrave; những mớ rắc rối cậu đ&atilde; g&acirc;y ra trong qu&aacute; khứ. Hiện giờ, điều duy nhất cậu muốn thực hiện đ&oacute; l&agrave; kết bạn với c&ocirc; g&aacute;i c&ugrave;ng lớp m&agrave; cậu th&iacute;ch. C&ugrave;ng với sư phụ &quot;linh lực gia&quot; Reigen của m&igrave;nh (h&oacute;a ra chỉ l&agrave; một g&atilde; lừa đảo), Mob dần nhận ra những mục ti&ecirc;u trong cuộc sống của m&igrave;nh.
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;V&Agrave; Đ&Acirc;Y L&Agrave; PHẦN 2 CỦA CẬU B&Eacute; MOB.&nbsp;&lt;/div&gt;

Legal High l&agrave; phi&ecirc;n bản remake của bộ phim h&agrave;i nổi tiếng c&ugrave;ng t&ecirc;n của Nhật Bản ph&aacute;t s&oacute;ng lần đầu tr&ecirc;n k&ecirc;nh Fuji TV v&agrave;o năm 2012. C&acirc;u chuyện trong phim xoay quanh Kensuke Komikado (Sakai Masato), một luật sư c&oacute; nhiều khuyết điểm như th&ocirc; lỗ, ngạo mạn, hoang ph&iacute;, h&aacute;m tiền, danh vọng v&agrave; phụ nữ. Nhưng anh c&oacute; tỉ lệ thắng kiện l&agrave; 100% v&agrave; sẵn s&agrave;ng l&agrave;m bất cứ điều g&igrave; v&igrave; quan điểm của m&igrave;nh l&agrave; &ldquo;kẻ thắng lu&ocirc;n đ&uacute;ng&rdquo;. 
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Kh&aacute;c với Kensuke Komikado, Mayuzumi Machiko (Aragaki Yui) l&agrave; một luật sư tận t&acirc;m mới v&agrave;o nghề, y&ecirc;u lẽ phải v&agrave; đầy nhiệt huyết trong việc bảo vệ kẻ yếu. Một ng&agrave;y nọ, do ho&agrave;n cảnh kh&ocirc;ng lường trước, Machiko Mayuzumi bắt đầu l&agrave;m việc tại văn ph&ograve;ng luật của Kensuke Komikado. Cả hai li&ecirc;n tục đụng độ, đấu đ&aacute; xung khắc trong hầu hết mọi thứ nhưng trong ph&ograve;ng xử &aacute;n họ hợp t&aacute;c c&ugrave;ng nhau để chiến đấu v&agrave; bảo vệ cho c&ocirc;ng l&yacute;.&lt;/div&gt;

Phim n&oacute;i về cuộc đời nhiều biến động của Tr&ugrave;ng Nhĩ - Tấn Văn c&ocirc;ng (Vương Long Hoa) một nh&acirc;n vật lịch sử c&oacute; thật của Trung Quốc. Trong thời kỳ Xu&acirc;n Thu, &ocirc;ng l&agrave; người được hậu thế v&ocirc; c&ugrave;ng đề cao, với t&agrave;i dụng binh d&ugrave;ng người, mưu tr&iacute; nhạy b&eacute;n. Tấn Văn C&ocirc;ng c&ugrave;ng Việt Vương C&acirc;u Tiễn l&agrave; hai vị qu&acirc;n chủ lu&ocirc;n được nhắc đến v&agrave; gắn liền với danh s&aacute;ch Ngũ b&aacute; thời Xu&acirc;n Thu. 
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Trải d&agrave;i cả trường đoạn lịch sử nhiều thay đổi, Tấn Văn C&ocirc;ng cũng từng c&oacute; nhiều cuộc t&igrave;nh, thống k&ecirc; sơ bộ &ocirc;ng phải c&oacute; &iacute;t nhất 10 vị phu nh&acirc;n . Nhưng trong số đ&oacute; , người duy nhất c&oacute; thể gi&agrave;nh được t&igrave;nh cảm ch&acirc;n ch&iacute;nh của &ocirc;ng l&agrave; ch&iacute;nh thất phu nh&acirc;n Tề Khương(Trương H&agrave;m Vận). Tề Khương l&agrave; con g&aacute;i của Tề Ho&agrave;n c&ocirc;ng, xinh đẹp hơn người, đặc biệt l&agrave; người phụ nữ th&ocirc;ng minh t&agrave;i tr&iacute;, rất biết c&aacute;ch đối nh&acirc;n xử thế . B&agrave; được gả cho Tấn Văn c&ocirc;ng trong thời gian &ocirc;ng đi chạy loạn, tuy ng&agrave;y th&aacute;ng ở b&ecirc;n nhau kh&ocirc;ng qu&aacute; d&agrave;i l&acirc;u nhưng t&igrave;nh cảm Tấn Văn c&ocirc;ng d&agrave;nh cho người th&ecirc; tử n&agrave;y rất s&acirc;u sắc, thậm ch&iacute; khi gặp biến loạn, &ocirc;ng v&igrave; qu&aacute; y&ecirc;u Tề Khương m&agrave; kh&ocirc;ng muốn rời bỏ b&agrave;.&nbsp;&lt;/div&gt;

Lee Ahn (Jin Young) c&oacute; khả năng t&acirc;m l&yacute; học đặc biệt. Bất cứ khi n&agrave;o chạm v&agrave;o ai đ&oacute;, anh c&oacute; thể đọc được k&yacute; ức của người đ&oacute;. Sử dụng khả năng t&acirc;m l&yacute; học của m&igrave;nh, Lee Ahn muốn ti&ecirc;u diệt những kẻ &aacute;c tr&ecirc;n thế giới. Kh&ocirc;ng giống như vẻ ngo&agrave;i đẹp trai của m&igrave;nh, Lee Ahn c&oacute; vẻ kh&ocirc;ng th&ocirc;ng minh cho lắm.
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Yoon Jae-In (Shin Ye-Eun) l&agrave; một c&ocirc; g&aacute;i bị tổn thương trong l&ograve;ng. C&ocirc; cố gắng che giấu điều đ&oacute;. Lee Ahn v&agrave; Yoon Jae-In t&igrave;nh cờ gặp nhau v&agrave; họ đấu tranh để giải quyết c&aacute;c vụ &aacute;n.&lt;/div&gt;

Bộ phim xoay quanh Trang Duệ l&agrave; một nh&acirc;n vi&ecirc;n c&ocirc;ng t&aacute;c của Điển Đương H&agrave;nh, sau khi gặp tại nạn, cặp mắt trở n&ecirc;n dị biến. Từ đ&oacute; cuộc sống của Trang Duệ thay đổi ho&agrave;n to&agrave;n.
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;

&lt;div&gt;V&agrave;o c&ugrave;ng một khoảnh khắc hơn 30 năm trước, 43 phụ nữ tr&ecirc;n to&agrave;n thế giới đ&atilde; hạ sinh những đứa trẻ d&ugrave; họ chưa từng mang thai. Đa số những đứa trẻ n&agrave;y đ&oacute; c&oacute; khả năng si&ecirc;u nhi&ecirc;n. Tỉ ph&uacute; Reginald Hargreeves đ&atilde; nhận nu&ocirc;i 7 trong số đ&oacute; v&agrave; huấn luyện họ trở th&agrave;nh những si&ecirc;u anh h&ugrave;ng v&agrave; lập n&ecirc;n Học viện Umbrella. Một trong 7 đứa trẻ c&oacute; khả năng đi xuy&ecirc;n kh&ocirc;ng v&agrave; xuy&ecirc;n thời gian đ&atilde; biến mất khi 13 tuổi để trở lại khi anh chị em m&igrave;nh đ&atilde; 30. Cậu n&oacute;i trong 8 ng&agrave;y nữa thế giới sẽ diệt vong&hellip;
&lt;/div&gt;&lt;div&gt;
&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;

Tần Trảm - một game thủ kỳ cựu đ&atilde; v&ocirc; t&igrave;nh đi v&agrave;o thế giới tr&ograve; chơi m&agrave; m&igrave;nh đ&atilde; quen thuộc trong suốt mười năm rồi trở th&agrave;nh đệ nhất cao thủ trong thế giới đ&oacute;. Ch&iacute;nh v&igrave; thế, anh cũng trở th&agrave;nh kẻ th&ugrave; số một của to&agrave;n thể v&otilde; l&acirc;m thi&ecirc;n hạ, anh thường xuy&ecirc;n phải đối mặt c&aacute;c &acirc;m mưu trong giang hồ c&ugrave;ng những người muốn triệt hạ m&igrave;nh.
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;

Dựa tr&ecirc;n creepypasta &lsquo;I Found a Hidden Door in My Cellar, and I Think I&rsquo;ve Made a Big Mistake&rsquo;, Channel Zero &ndash; The Dream Door kể về một cặp vợ chồng chuyển tới một ng&ocirc;i nh&agrave; mới v&agrave; ph&aacute;t hiện một c&aacute;nh cửa b&iacute; mật ở tầng hầm. Từ đ&acirc;y, những b&iacute; mật thầm k&iacute;n của mỗi người dần được h&eacute; lộ.
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;

Bước ch&acirc;n của người khổng lồ sống giữa d&ograve;ng dung nham c&oacute; thể ph&aacute; hủy cả ng&ocirc;i th&agrave;nh&hellip;.
&lt;div&gt;&Aacute;c ma vực s&acirc;u lu&ocirc;n muốn tiến v&agrave;o c&aacute;i thế giới n&agrave;y&hellip;
&lt;/div&gt;&lt;div&gt;M&agrave; thần linh gi&aacute;ng trần, đi lại giữa nh&acirc;n gian truyền b&aacute; sự vinh quanh của họ&hellip;.
&lt;/div&gt;&lt;div&gt;Nhưng to&agrave;n bộ thế giới lại do đế quốc Long Sơn thống trị. Đ&acirc;y l&agrave; một đế quốc của con người. To&agrave;n bộ những tri thức uy&ecirc;n b&aacute;c được cất giữ trong th&aacute;p ph&aacute;p sư cả trăm, ng&agrave;n năm&hellip;. C&aacute;c kỵ sĩ tuần tra canh giữ bầu trời, mặt đất v&agrave; tr&ecirc;n biển&hellip;.
&lt;/div&gt;&lt;div&gt;Tại tỉnh An Dương của đế quốc c&oacute; một l&atilde;nh địa của qu&yacute; tộc rất b&igrave;nh thường gọi l&agrave; Tuyết Ưng lĩnh&hellip;
&lt;/div&gt;&lt;div&gt;C&acirc;u chuyện được bắt đầu từ nơi n&agrave;y&lt;/div&gt;

V&agrave;o thời xa xưa, c&oacute; một truyền thuyết về những con quỷ ăn thịt người lu&ocirc;n l&atilde;ng v&atilde;ng trong c&aacute;nh rừng s&acirc;u. V&igrave; điều n&agrave;y, người d&acirc;n trong l&agrave;ng kh&ocirc;ng bao giờ đi ra ngo&agrave;i v&agrave;o trời tối. Truyền thuyến cũng kể rằng c&oacute; một S&aacute;t Quỷ Nh&acirc;n lu&ocirc;n xuất hiện v&agrave;o ban đ&ecirc;m để ti&ecirc;u diệt những con quỷ kh&aacute;t m&aacute;u n&agrave;y. Đối với ch&agrave;ng trai trẻ Tanjiro, c&acirc;u chuyện d&acirc;n gian ấy đ&atilde; trở th&agrave;nh hiện thực cay đắng m&agrave; cậu phải hứng chịu...
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Sau khi cha cậu qua đời, Tanjiro lu&ocirc;n cố gắng hết sức để trở th&agrave;nh trụ cột trong gia đ&igrave;nh. D&ugrave; cuộc sống vất vả, cực khổ, những gia đ&igrave;nh của cậu vẫn lu&ocirc;n ngập tr&agrave;n hạnh ph&uacute;c. Nhưng niềm hạnh ph&uacute;c ấy cũngkh&ocirc;ng k&eacute;o d&agrave;i l&acirc;u được. Một ng&agrave;y nọ, khi Tanjiro trở về, cậu ph&aacute;t hiện gia đ&igrave;nh m&igrave;nh đ&atilde; bị s&aacute;t hại d&atilde; man, v&agrave; chỉ c&oacute; một người duy nhất sống s&oacute;t, đ&oacute; l&agrave; em g&aacute;i Nezuko của cậu. Nhưng bi kịch thay, Nezuko đ&atilde; trở th&agrave;nh con quỷ đ&aacute;ng sợ. Tuy nhi&ecirc;n, c&ocirc; vẫn c&ograve;n giữ một ch&uacute;t nh&acirc;n t&iacute;nh. Đ&oacute; l&agrave; thời điểm bắt đầu cuộc chiến đơn độc của Tanjiro, ti&ecirc;u diệt quỷ v&agrave; t&igrave;m c&aacute;ch biến em g&aacute;i m&igrave;nh trở lại l&agrave;m người.&lt;/div&gt;

Thần Poseidon Của T&ocirc;i kể về nữ sinh t&agrave;i năng của trường địa chất hải dương An Phi (L&yacute; Khải Hinh), c&ocirc; y&ecirc;u thầm chuy&ecirc;n gia nghi&ecirc;n cứu trẻ tuổi Mạc L&atilde;nh, lu&ocirc;n mơ ước một một ng&agrave;y n&agrave;o đ&oacute; c&oacute; thể s&aacute;t c&aacute;nh c&ugrave;ng anh trở th&agrave;nh cặp đ&ocirc;i ưu t&uacute; của viện nghi&ecirc;n cứu.
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Tuy nhi&ecirc;n khi giấc mơ c&ograve;n chưa kịp th&ecirc;u dệt th&igrave; thiếu ni&ecirc;n đẹp trai Diệp Hải (Trương V&acirc;n Long) bất ngờ xuất hiện trong cuộc sống của c&ocirc;. Anh kh&ocirc;ng những mang đến xui xẻo, kh&ocirc;ng chỉ l&agrave;m x&aacute;o trộn mọi chuyện m&agrave; c&ograve;n biến th&agrave;nh thần Poseidon (thần cai quản biển cả trong Thần thoại Hy Lạp), d&otilde;ng dạc tuy&ecirc;n bố c&ocirc; ch&iacute;nh l&agrave; Amphitrite - ho&agrave;ng hậu biển cả của m&igrave;nh.
&lt;/div&gt;&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Trải qua nhiều t&igrave;nh huống, c&ocirc; ph&aacute;t hiện k&yacute; ức của m&igrave;nh thật sự c&oacute; t&igrave;nh cảm s&acirc;u đậm với Diệp Hải. Ho&aacute; ra trong truyền thuyết hai người thật sự l&agrave; Poseidon v&agrave; Amphitrite, những vị thần c&oacute; chức tr&aacute;ch bảo vệ đại dương.&lt;/div&gt;

A mysterious person restarts the Mirror World&#039;s Rider Battle, thus making Shinji Kido and other war participants regain their memories and transforming abilities. With the appearance of Another Ryuki, Sougo Tokiwa and Geiz Myokoin investigate this event, becoming involved in the war themselves...
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;

Thiếu ni&ecirc;n Th&aacute;i Tuế lớn l&ecirc;n ở Đại Tống thời kỳ suy yếu, ngoại địch đe dọa . V&ocirc; t&igrave;nh cậu tham gia v&agrave;o 1 tổ chức b&iacute; mật l&agrave; Bắc Đẩu. Vũ Dao Quang v&agrave; Liễu T&ugrave;y Phong l&agrave; những thanh ni&ecirc;n nhiệt huyết c&ugrave;ng tham gia tổ chức. Bắc Đẩu tư l&agrave; 1 cơ quan dưới quyền chỉ huy của ho&agrave;ng đế chuy&ecirc;n điều tra c&aacute;c vụ &aacute;n kỳ lạ.
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Th&ocirc;ng qua một loạt c&aacute;c vụ &aacute;n, Th&aacute;i Tuế thấy rằng c&oacute; những &acirc;m mưu ẩn giấu đằng sau những vụ &aacute;n n&agrave;y, v&agrave; n&oacute; cũng li&ecirc;n quan đến th&acirc;n thế b&iacute; ẩn của ch&iacute;nh anh. Trong qu&aacute; tr&igrave;nh theo đuổi sự thật, Th&aacute;i Tuế đ&atilde; gặp nguy hiểm nhiều lần, nhưng vẫn giữ vững lập trường ban đầu của m&igrave;nh, kh&ocirc;ng chịu khuất phục trước thế lực xấu xa, đo&agrave;n kết bạn b&egrave; với l&ograve;ng trung th&agrave;nh, t&igrave;nh bạn v&agrave; tr&iacute; tuệ, v&agrave; tiếp tục điều tra. Cuối c&ugrave;ng, với sự gi&uacute;p đỡ của nh&oacute;m bạn ch&iacute;nh nghĩa, cuối c&ugrave;ng họ đ&atilde; t&igrave;m ra v&agrave; trừng phạt kẻ chủ mưu gi&uacute;p đỡ c&ocirc;ng l&yacute;, loại bỏ c&aacute;i &aacute;c v&agrave; mang lại lợi &iacute;ch cho người d&acirc;n. Th&aacute;i Tuế cuối c&ugrave;ng đ&atilde; t&igrave;m lại được gia đ&igrave;nh đ&atilde; mất v&agrave; c&oacute; được t&igrave;nh y&ecirc;u của m&igrave;nh.&lt;/div&gt;

Trở V&ecirc;̀ Minh Tri&ecirc;̀u Làm Vương Gia, Royal Highness 2018
&lt;div&gt;Phim Trở V&ecirc;̀ Minh Tri&ecirc;̀u Làm Vương Gia V&agrave;o những năm Hoằng Trị (ni&ecirc;n hiệu của vua Hiếu T&ocirc;ng thời Minh), t&uacute; t&agrave;i Dương Lăng trong ng&agrave;y cưới của m&igrave;nh đột nhi&ecirc;n ng&atilde; xuống đất kh&ocirc;ng dậy nổi. Mấy ng&agrave;y sau, Dương Lăng khỏi bệnh, nh&igrave;n thấy gia cảnh ngh&egrave;o kh&oacute;, đối với người vợ mới H&agrave;n Ấu Nương, Dương Lăng đột nhi&ecirc;n thấy xấu hổ, b&egrave;n quyết định b&aacute;n hết đất vườn, l&ecirc;n kinh đi thi. Đến dịch qu&aacute;n K&ecirc; Minh, Dương Lăng d&ugrave;ng tr&iacute; th&ocirc;ng minh gi&uacute;p M&atilde; Ngang giải oan giết người, Dương Lăng v&igrave; thế được Huyện lệnh khen ngợi, trở th&agrave;nh sư gia huyện K&ecirc; Minh. Muội muội M&atilde; Ngang l&agrave; M&atilde; Li&ecirc;n Nhi cũng v&igrave; thế m&agrave; động l&ograve;ng thiếu nữ. 
&lt;/div&gt;&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Sau đ&oacute;, tr&ecirc;n chiến trường Dương Lăng c&ugrave;ng th&aacute;i tử Chu Hậu Chiếu l&uacute;c đ&oacute; đang cải trang trở th&agrave;nh bạn b&egrave; sinh tử. Dương Lăng trở th&agrave;nh thư đồng, theo th&aacute;i tử về kinh. 2 người ở trong cung kề vai chiến đấu, ph&aacute; tan nhiều &acirc;m mưu nguy hiểm. Cuối c&ugrave;ng Dương Lăng trợ gi&uacute;p Chu Hậu Chiếu l&ecirc;n ng&ocirc;i ho&agrave;ng đế, qu&eacute;t sạch tham quan, củng cố ho&agrave;ng quyền. Dương Lăng từ 1 t&uacute; t&agrave;i b&igrave;nh thương trở th&agrave;nh 1 vương gia kh&aacute;c họ (&yacute; muốn n&oacute;i tuy Dương Lăng kh&ocirc;ng phải t&ocirc;ng thất nhưng vẫn được phong Vương), trở th&agrave;nh 1 truyền kỳ chốn nh&acirc;n gian.&lt;/div&gt;

Tinh Thần Biến l&agrave; một tiểu thuyết v&otilde; hiệp c&oacute; nội dung về một c&acirc;u Truyện Ti&ecirc;n Hiệp ho&agrave;nh tr&aacute;ng kể về người thanh ni&ecirc;n Tần Vũ gian khổ tu luyện, vượt hết kh&oacute; khăn n&agrave;y đến nguy hiểm kh&aacute;c để l&ecirc;n Thần Giới t&igrave;m người y&ecirc;u.
&lt;div&gt;Tần Vũ đ&atilde; gặp duy&ecirc;n kỳ ngộ học được Tinh Thần Biến c&ocirc;ng ph&aacute;p của L&ocirc;i Vệ, gian khổ tu luyện để l&agrave;m cho người th&acirc;n m&igrave;nh an to&agrave;n, nhờ sự gi&uacute;p sức của Lan th&uacute;c(ch&uacute; của người y&ecirc;u) v&agrave; Nghịch Ương ti&ecirc;n đế để phi thăng l&ecirc;n ti&ecirc;n giới v&agrave; thần giới, nhưng rồi tại thần giới tranh đấu với cả nh&agrave; thần vương của L&ocirc;i Phạt th&agrave;nh v&agrave; L&ocirc;i Phạt thi&ecirc;n t&ocirc;n, cuối c&ugrave;ng nhờ sự gi&uacute;p sức của L&ocirc;i M&ocirc;ng (sau n&agrave;y l&agrave; nhị sư huynh của Tần Vũ v&agrave; cũng l&agrave; L&acirc;m L&ocirc;i trong truyện B&agrave;n Long c&ugrave;ng t&aacute;c giả) ph&aacute;t triển l&ecirc;n sau n&agrave;y đ&atilde; s&aacute;ng tạo ra Tần M&ocirc;ng vũ trụ của ri&ecirc;ng m&igrave;nh.
&lt;/div&gt;&lt;div&gt;
Tinh Thần Biến mang đậm sắc th&aacute;i ti&ecirc;n, thần, lấy tinh thần dũng cảm vượt kh&oacute; khăn, cố gắng đến cực hạn của bản th&acirc;n nh&acirc;n vật ch&iacute;nh để đi t&igrave;m được t&igrave;nh y&ecirc;u của m&igrave;nh.&lt;/div&gt;

Hyakki-maru đ&atilde; bị cha m&igrave;nh đem 48 bộ phận tr&ecirc;n cơ thể anh cho lũ y&ecirc;u ma để đổi lại sức mạnh thống b&aacute; thi&ecirc;n hạ, v&igrave; vậy khi anh sinh ra nh&igrave;n kh&ocirc;ng kh&aacute;c n&agrave;o một qu&aacute;i thai, kh&ocirc;ng mắt kh&ocirc;ng mũi kh&ocirc;ng tay kh&ocirc;ng ch&acirc;n. Hyakko-maru bị bỏ tr&ocirc;i s&ocirc;ng nhưng may c&oacute; &ocirc;ng thầy ph&aacute;p cứu anh về v&agrave; tạo cho anh 1 cơ thể mới. Sau khi lớn l&ecirc;n, Hyakki-maru quyết t&acirc;m giết sạch lũ y&ecirc;u ma để lấy lại cơ thể thật sự của ch&iacute;nh anh m&agrave; ch&uacute;ng đang chiếm giữ. C&ugrave;ng với Dororo, 1 t&ecirc;n cướp vặt m&agrave; anh mới quen biết, hai người c&ugrave;ng s&aacute;t c&aacute;nh b&ecirc;n nhau ti&ecirc;u diệt lũ y&ecirc;u ma.....
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;

Sex Education theo ch&acirc;n cậu nam sinh &ldquo;c&ograve;n trinh trắng&rdquo; Otis (Asa Butterfield) tổ chức một buổi trị liệu t&igrave;nh dục trong trường học của m&igrave;nh, lấy cảm hứng từ ch&iacute;nh c&ocirc;ng việc của mẹ. Otis lu&ocirc;n cảm thấy kh&ocirc;ng hứng th&uacute; với những vấn đề về t&igrave;nh dục v&agrave; điều đ&oacute; khiến mẹ lẫn bạn b&egrave; cậu kh&aacute; quan ngại. Mọi chuyện bắt đầu dở kh&oacute;c dở cười hơn khi c&ocirc; bạn nổi loạn đề xuất về ph&ograve;ng tư vấn t&acirc;m sinh l&yacute; tuổi mới lớn.
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Kh&ocirc;ng chỉ muốn gi&uacute;p cải thiện đời sống chăn gối cho c&aacute;c bạn m&igrave;nh, mục đ&iacute;ch của &yacute; tưởng t&aacute;o bạo n&agrave;y của cậu b&eacute; c&ograve;n l&agrave; để cưa đổ c&ocirc; g&aacute;i trong mơ Maeve (Emma Mackey) - một nữ sinh th&ocirc;ng minh v&agrave; c&aacute; t&iacute;nh, v&agrave; cũng l&agrave; &ldquo;đối t&aacute;c&rdquo; của Otis trong buổi trị liệu.&lt;/div&gt;

Phim lấy bối cảnh những năm đầu thời đại C&agrave;n Long, thiếu nữ Ngụy Anh Lạc (Ng&ocirc; Cẩn Ng&ocirc;n) v&agrave;o cung l&agrave;m cung nữ để điều tra ch&acirc;n tướng về c&aacute;i chết của người chị g&aacute;i v&agrave; thề gi&agrave;nh lại c&ocirc;ng l&yacute; cho chị m&igrave;nh. Ph&uacute; S&aacute;t ho&agrave;ng hậu (Tần Lam) l&agrave; người hiền đức, tu&acirc;n theo lễ ph&aacute;p, lo lắng Anh Lạc lầm đường lạc lối, v&igrave; vậy lu&ocirc;n tận lực trợ gi&uacute;p v&agrave; quan t&acirc;m c&ocirc;. Dưới sự dạy bảo của ho&agrave;ng hậu, Ngụy Anh Lạc từng bước trưởng th&agrave;nh v&agrave; trở th&agrave;nh một nữ quan ch&iacute;nh trực, ki&ecirc;n cường, bỏ lại l&ograve;ng o&aacute;n hận để sống một cuộc sống đ&uacute;ng đắn.
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Sau đ&oacute; ho&agrave;ng hậu bất hạnh qua đời, khiến Ngụy Anh Lạc đối với C&agrave;n Long (Nhiếp Viễn) hiểu lầm chồng chất, hai người từ căm gh&eacute;t lẫn nhau cuối c&ugrave;ng dần thấu hiểu v&agrave; gi&uacute;p đỡ đối phương. Anh Lạc bằng sự dũng cảm, tr&iacute; th&ocirc;ng minh linh hoạt, &yacute; ch&iacute; rộng lớn đ&atilde; h&oacute;a giải những kh&oacute; khăn tr&ugrave;ng điệp chốn cung đ&igrave;nh, cuối c&ugrave;ng trở th&agrave;nh Ho&agrave;ng Qu&yacute; phi gi&uacute;p đỡ ho&agrave;ng đế C&agrave;n Long x&acirc;y dựng thời th&aacute;i b&igrave;nh thịnh thế.&lt;/div&gt;

Trong bạn đang &ocirc;m ấp một sự ho&agrave;n hảo thế n&agrave;o? Sự ho&agrave;n hảo l&yacute; tưởng của bạn l&agrave; g&igrave;? Vi&ecirc;n m&atilde;n về t&igrave;nh th&acirc;n hay t&igrave;nh y&ecirc;u?
&lt;div&gt;Triệu V&ocirc; Hạn, Triệu Vi&ecirc;n M&atilde;n, Hầu Tử Th&agrave;nh, L&acirc;m mai T&acirc;m l&agrave; những c&ocirc; những đứa trẻ lớn l&ecirc;n trong c&ugrave;ng một c&ocirc; nhi vi&ecirc;n ở một v&ugrave;ng qu&ecirc;, v&agrave; l&agrave; bạn b&egrave; tốt của nhau. Họ chẳng c&oacute; g&igrave; đ&aacute;ng gi&aacute; ngo&agrave;i t&igrave;nh bạn ch&acirc;n th&agrave;nh, tạo n&ecirc;n một nh&oacute;m gọi l&agrave; &ldquo;Bang Vi&ecirc;n Vi&ecirc;n&rdquo;.
&lt;/div&gt;&lt;div&gt;Họ c&ugrave;ng nhau trưởng th&agrave;nh v&agrave; theo đuổi ước mơ. V&ocirc; Hạn v&agrave; Vi&ecirc;n M&atilde;n l&agrave; một cặp được định sẵn, tr&ecirc;n con đường kiếm t&igrave;m hạnh ph&uacute;c của m&igrave;nh, c&oacute; thể họ sẽ gặp những vấp ng&atilde;, hay những n&uacute;t thắt kh&oacute; gỡ, nhưng cuối c&ugrave;ng cũng vẫn sẽ đi theo quỹ đạo của sự &ldquo;vi&ecirc;n m&atilde;n&rdquo;.&lt;/div&gt;

&lt;p&gt;Chuyện t&igrave;nh đại học Y - Phim Th&aacute;i Lan, c&oacute; tất cả l&agrave; 8 tập. Đ&acirc;y l&agrave; một bộ phim về qu&aacute; tr&igrave;nh m&agrave;i giũa v&agrave; trưởng th&agrave;nh của c&aacute;c b&aacute;c sĩ/y t&aacute; tương lai, với sự tham gia của d&agrave;n diễn vi&ecirc;n trẻ to&agrave;n trai xinh g&aacute;i đẹp.&lt;br&gt;
Mời c&aacute;c bạn đ&oacute;n xem để biết được những &aacute;p lực của những người mang tr&ecirc;n m&igrave;nh trọng tr&aacute;ch về vấn đề sống c&ograve;n của người kh&aacute;c. V&agrave; c&ugrave;ng trải qua cuộc sống mới với những niềm vui - nỗi buồn, nụ cười - nước mắt trong cuộc sống c&ocirc;ng việc cũng như t&igrave;nh cảm của những thi&ecirc;n thần &aacute;o trắng&nbsp;&lt;/p&gt;

&lt;p&gt;&nbsp;&lt;/p&gt;

Ch&agrave;ng thiếu ni&ecirc;n Lộ Kiệt lớn l&ecirc;n ở Mỹ, l&agrave; tay đua thi&ecirc;n t&agrave;i. Mặc d&ugrave; bố Lộ Kiệt lu&ocirc;n phản đối con trai đua xe. Một lần l&eacute;n tham gia v&agrave;o trận đua xe ở chợ đen, Lộ Kiệt bất ngờ được Quản l&yacute; đội đua xe Thi&ecirc;n D&atilde; nh&igrave;n tr&uacute;ng. Thi&ecirc;n D&atilde; thuyết phục Lộ Kiệt tham gia v&agrave;o đội đua xe, thực hiện ước mơ của m&igrave;nh. Lộ Kiệt v&agrave; Thi&ecirc;n D&atilde; c&ugrave;ng nhau cố gắng, chiến thắng được tay đua nổi tiếng David, nhanh ch&oacute;ng trở th&agrave;nh ng&ocirc;i sao mới trong giới đua xe, cũng d&ugrave;ng t&igrave;nh cảm m&atilde;nh liệt của m&igrave;nh đối với đua xe m&agrave; cảm động được bố, h&oacute;a giải kh&uacute;c mắc giữa hai bố con. Lộ Kiệt v&agrave; Thi&ecirc;n D&atilde; c&ugrave;ng y&ecirc;u c&ocirc; g&aacute;i Trung Quốc l&eacute;m lỉnh.
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Chỉ v&igrave; c&aacute;i lợi trước mắt, Thi&ecirc;n D&atilde; ngo&agrave;i &yacute; muốn hại chết bố của Lộ Kiệt, khiến anh em trở mặt th&agrave;nh th&ugrave;. Mất đi tất cả, Thi&ecirc;n D&atilde; gia nhập v&agrave;o một đội đua xe &ldquo;đen&rdquo;, trở th&agrave;nh đối thủ lớn nhất của Lộ Kiệt. B&ecirc;n cạnh đ&oacute;, Lộ Kiệt c&ograve;n phải đối mặt với cuộc giải phẫu tim c&oacute; độ nguy hiểm v&ocirc; c&ugrave;ng cao. Hai người ở hai thế giới kh&aacute;c nhau, kh&ocirc;ng ngừng so t&agrave;i, Thi&ecirc;n D&atilde; ng&agrave;y c&agrave;ng trượt d&agrave;i, dường như đ&atilde; kh&ocirc;ng c&ograve;n đường quay đầu. Nhưng ở thời khắc cuối c&ugrave;ng của trận chung kết, Lộ Kiệt v&agrave; Thi&ecirc;n D&atilde; c&ugrave;ng đuổi theo tốc độ, đuổi theo t&igrave;nh cảm anh em vẫn chưa từng thay đổi, họ c&ugrave;ng t&igrave;m lại ước mơ, nhiệt huyết của tuổi thanh xu&acirc;n, một lần nữa c&ugrave;ng kề vai chiến đấu...&lt;/div&gt;

Phim được chuyển thể từ webtoon triệu view đ&igrave;nh đ&aacute;m xứ sở ch&ugrave;a v&agrave;ng với sự tham gia của hai diễn vi&ecirc;n trẻ l&agrave; Jane Ramida Jiranorraphat v&agrave; Perawat Kristtps Sangpotirat.
&lt;div&gt;Phim đề cập đến vấn đề nhạy cảm trong m&ocirc;i trường học đường đ&oacute; l&agrave; &ldquo;quan hệ&rdquo; ở tuổi vị th&agrave;nh ni&ecirc;n. C&acirc;u chuyện xoay quanh Fah (Jane Ramida Jiranorraphat) &ndash; nữ sinh trung học, đ&aacute;ng y&ecirc;u, ngoan ngo&atilde;n v&agrave; sống trong sự bảo bọc của gia đ&igrave;nh. Bạn trai của Fah l&agrave; Mek (Perawat Kristtps Sangpotirat), nam sinh điển trai, giỏi thể thao. Cậu lu&ocirc;n chịu sự kiểm so&aacute;t nghi&ecirc;m ngặt của mẹ mọi l&uacute;c mọi nơi.
&lt;/div&gt;&lt;div&gt;Đ&ocirc;i trẻ đ&atilde; &ldquo;vượt r&agrave;o&rdquo;v&agrave; Fah c&oacute; thai khi mới 18 tuổi. Khi ph&aacute;t hiện m&igrave;nh c&oacute; em b&eacute;, Fah v&ocirc; c&ugrave;ng hoảng loạn v&agrave; c&ocirc; quyết định bỏ trốn, xa l&aacute;nh mọi người, cha mẹ v&agrave; kể cả bạn trai Mek. Thiếu nữ 18 tuổi đ&atilde; phải đối mặt với nhiều chuyện kh&oacute; khắn khi mang thai.
&lt;/div&gt;&lt;div&gt;
&lt;/div&gt;&lt;div&gt;V&igrave; tuổi trẻ bồng bột n&ecirc;n Mek sống hơi v&ocirc; tr&aacute;ch nhiệm v&agrave; bất cần. Tuy nhi&ecirc;n khi biết bạn g&aacute;i m&igrave;nh c&oacute; thai, Mek đ&atilde; thay đổi, h&agrave;nh động c&oacute; tr&aacute;ch nhiệm v&agrave; giải quyết hậu quả do m&igrave;nh g&acirc;y ra.&lt;/div&gt;

Bodyguard xoay quanh nh&acirc;n vật Trung sĩ Cảnh s&aacute;t David Budd - một cựu chiến binh trong chiến tranh qu&acirc;n đội, đang l&agrave;m việc tại sở cảnh s&aacute;t Metropolitan London. Một ng&agrave;y t&igrave;nh cờ, David được giao nhiệm vụ bảo vệ người m&agrave; anh v&ocirc; c&ugrave;ng khinh thường: bộ trưởng Bộ Nội Vụ Julia Montague. 
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Với những pha h&agrave;nh động gay cấn, những m&agrave;n đấu n&atilde;o căng thẳng, Bodyguard nhanh ch&oacute;ng tạo n&ecirc;n một cơn sốt ở nước Anh. Thậm ch&iacute;, bộ phim c&ograve;n đạt được kỷ lục với tận 6,9 triệu người xem - một con số đ&aacute;ng mơ ước của bất cứ series truyền h&igrave;nh n&agrave;o.
&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;

&lt;div&gt;
&lt;div&gt;
&lt;div&gt;Trong &lt;strong&gt;phim Li&ecirc;n Minh C&ocirc;ng L&yacute; Trẻ 2&lt;/strong&gt;, ở&nbsp;phần trước, c&aacute;c th&agrave;nh vi&ecirc;n trụ cột của Li&ecirc;n Minh C&ocirc;ng L&yacute; đ&atilde; bị điều khiển. Trong &lt;a href=&quot;https://fimfast.com&quot;&gt;phim online&lt;/a&gt; n&agrave;y, khi tỉnh lại nhờ sự gi&uacute;p đỡ của nh&oacute;m Teen Titans, họ kh&ocirc;ng nhớ ra m&igrave;nh đ&atilde; l&agrave;m g&igrave; trong 16 giờ, liệu hậu quả g&igrave; sẽ xảy ra do 16 giờ đ&oacute;?&nbsp;Liệu &lt;em&gt;&lt;strong&gt;phim hd&lt;/strong&gt;&lt;/em&gt; n&agrave;y sẽ diễn biến thế n&agrave;o mời c&aacute;c bạn c&ugrave;ng theo d&otilde;i bộ &lt;em&gt;phim&nbsp;Li&ecirc;n Minh C&ocirc;ng L&yacute; Trẻ 2.&lt;/em&gt;&lt;/div&gt;
&lt;/div&gt;
&lt;/div&gt;

Thời d&acirc;n quốc, th&acirc;n l&agrave; truyền nh&acirc;n đời thứ 48 của Dương gia thương ph&aacute;p, thanh ni&ecirc;n th&ocirc;n qu&ecirc; Dương Tiểu Lang từ nhỏ đ&atilde; cực gh&eacute;t tập v&otilde;. B&agrave; ngoại hận Thiết Th&agrave;nh Cương n&ecirc;n bắt buộc Dương Tiểu Lang đến Giang th&agrave;nh ở nhờ nh&agrave; nhị th&uacute;c Lưu Qu&aacute;ch, l&agrave; &ocirc;ng chủ của một tửu lầu trung hoa. Ở nơi phức tạp như Giang th&agrave;nh, Dương Tiểu Lang, Ch&acirc;u To&agrave;n ở cục cảnh s&aacute;t v&agrave; Thanh Long hội đối nghịch với đ&aacute;m người T&acirc;y Dương. Vốn cho rằng c&oacute; thể gần b&ugrave;n nhưng kh&ocirc;ng d&iacute;nh b&ugrave;n, nhưng Dương Tiểu Lang lại ph&aacute;t hiện m&igrave;nh đang rơi v&agrave;o một &acirc;m mưu lớn của c&aacute;c cỗ thế lực đ&oacute; b&agrave;y ra.
&lt;div&gt;
&lt;/div&gt;&lt;div&gt;Để bảo vệ Tiểu Ph&agrave;m, c&ocirc; g&aacute;i m&igrave;nh y&ecirc;u mến, Dương Tiểu Lang đ&atilde; đứng ra đương đầu. Dựa v&agrave;o bộ v&otilde; c&ocirc;ng tuyệt học &quot;Sai Thời Thuật&quot; được truyền thụ từ chỗ du hiệp giang hồ Vương Xử Nhị c&ugrave;ng với c&aacute;i lưỡi kh&ocirc;ng xương của m&igrave;nh, liệu Dương Tiểu Lang c&oacute; thể trở th&agrave;nh một anh h&ugrave;ng hảo h&aacute;n bảo vệ Giang th&agrave;nh v&agrave; người m&igrave;nh y&ecirc;u được kh&ocirc;ng?&lt;/div&gt;
